import React, { Component } from 'react';
import './App.scss';
class Comp1 extends Component {
    render() {
        return (
            <div>
                <table>
                    <tr>
                        <th>Firstname</th>
                        <th>Lastname</th>
                    </tr>
                    <tr>
                        <td>Peter</td>
                        <td>Griffin</td>
                    </tr>
                    <tr>
                        <td>Lois</td>
                        <td>Griffin</td>
                    </tr>
                </table>
            </div>
        );
    }
}

export default Comp1;
